"use strict";

class HolbertonCourse {
  constructor(name, length, students) {
    if (typeof name === 'string') {
      this._name = name;
    }
    if (typeof length === 'number') {
      this._length = length;
    }
    if (Array.isArray(students)) {
      if (students.every(item => typeof item === 'string')) {
        this._students = students;
      }
    }
  }

  //setter for name
  set name(new_name) {
    if (typeof new_name === 'string') {
      this._name = new_name;
    }
  }
  //getter for name
  get name() {
    return this.name;
  }

  //setter for length
  set length(new_length) {
    if (typeof new_length === 'number') {
      this._length = new_lengthlength;
    }
  }
  //getter for length
  get length() {
    return this._length;
  }

  //setter for students
  set students(new_students) {
    if (Array.isArray(new_students)) {
      if (new_students.every(item => typeof item === 'string')) {
        this._students = new_students;
      }
    }
  }
  //getter for students
  get students() {
    return this._students;
